"use client";

import { useState, FormEvent } from "react";
import Image from "next/image";
import { MenuItem, RestaurantMenu } from "./helpers/types";
import ErrorMessage from "./components/ErrorMessage";
import { getAllergenDescriptions } from "./helpers/allergens";
import { formatDate } from "./helpers/functions";
import { ERROR_MESSAGES } from "./helpers/const";

export default function Home() {
  // Sample data based on the example
  const data: RestaurantMenu = {
    restaurant_name: "Restaurace Example",
    source_url: "http://example.com/menu",
    daily_menu: true,
    date: "2025-11-14",
    menu_items: [
      {
        category: "polévka",
        name: "Hovězí vývar",
        price: 65,
        allergens: ["1", "3", "9"],
      },
      {
        category: "hlavní jídlo",
        name: "Kuřecí řízek s bramborovou kaší",
        price: 145,
        allergens: ["1", "3", "7"],
        weight: "150g",
      },
      {
        category: "dezert",
        name: "Panna cotta",
        price: 145,
        allergens: ["7"],
        weight: "",
      },
      {
        category: "polévka",
        name: "Zeleninový vývar s nudlemi",
        price: 40,
        allergens: [],
        weight: "175g",
      },
    ],
    launch_menu: true,
    breakfast_menu: false,
    image_base64:
      //"data:image/png;base64,",
      "data:image/jpeg;base64,",
  };

  // Group menu items by dish category
  const groupDishes = (menu_items: MenuItem[]) =>
    menu_items.reduce((acc, item) => {
      if (!acc[item.category]) {
        acc[item.category] = [];
      }
      acc[item.category].push(item);
      return acc;
    }, {} as Record<string, MenuItem[]>);

  const now = new Date();
  const dateGiven = new Date(data.date);
  const dateIsToday =
    dateGiven.getFullYear() === now.getFullYear() &&
    dateGiven.getMonth() === now.getMonth() &&
    dateGiven.getDate() === now.getDate();

  const [error, setError] = useState<string | null>(
    !dateIsToday
      ? ERROR_MESSAGES.DATE_MISMATCH
      : !data.menu_items?.length
      ? ERROR_MESSAGES.NO_MENU_ITEMS
      : null
  );

  const [url, setUrl] = useState<string>("");
  const [responseString, setResponseString] = useState<string>("");
  const [isLoading, setIsLoading] = useState<boolean>(false);

  const handleSubmit = async (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setError(null);
    setIsLoading(true);

    try {
      const res = await fetch("/menu", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ url }),
      });

      if (!res.ok) {
        let msg = ERROR_MESSAGES.UNREACHABLE_URL;
        try {
          const j = await res.json();
          msg = j?.error || msg;
        } catch {}
        setError(msg);
        setIsLoading(false);
        return;
      }

      const parsed = await res.json();
      setResponseString(JSON.stringify(parsed));
      setError(null);
      setIsLoading(false);
    } catch {
      setError(ERROR_MESSAGES.UNREACHABLE_URL);
      setIsLoading(false);
    }
  };

  const menuContent = Object.entries(groupDishes(data.menu_items)).map(
    ([category, items]) => (
      <div key={category} className="mb-6">
        <h3 className="text-xl mb-2 capitalize font-bold">{category}</h3>
        <ul className="space-y-2">
          {items.map((item, index) => (
            <li key={index}>
              <div className="flex justify-between items-start">
                <div>
                  <p className="text-lg">{item.name}</p>
                  {item.weight && (
                    <p className="text-sm">Porce: {item.weight}</p>
                  )}
                  {item.allergens && item.allergens.length > 0 && (
                    <p className="text-sm">
                      Alergeny:{" "}
                      {getAllergenDescriptions(item.allergens).join(", ")}
                    </p>
                  )}
                </div>
                <p className="font-medium">{item.price} CZK</p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    )
  );

  const imageSrc = data.image_base64
    ? data.image_base64.startsWith("data:")
      ? data.image_base64
      : `data:image/png;base64,${data.image_base64}`
    : "/favicon.png";

  const hasImage = !!data.image_base64?.length; // needed to apply blur effect only IF image is present

  return (
    <div className="container mx-auto p-4 max-w-4xl">
      <h1 className="text-3xl mt-6 mb-3 text-center">
        Aktuální nabídka menu na dnešek,
      </h1>
      <h2 className="text-2xl mb-6 text-center"> {formatDate(data.date)}</h2>
      <form
        className="flex flex-col sm:flex-row gap-4 mb-8 max-w-lg mx-auto"
        onSubmit={handleSubmit}
      >
        <input
          type="url"
          placeholder="Zadejte URL menu restaurace"
          className="flex-1 p-2"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          required
        />
        <button type="submit" className="px-4 py-2">
          Odeslat
        </button>
      </form>

      {isLoading && (
        <div className="mt-6 text-center">
          <p className="text-lg">Loading...</p>
        </div>
      )}

      {responseString && (
        <div className="mt-6">
          <h2 className="text-xl font-bold mb-2">Response:</h2>
          <div className="bg-gray-100 p-4 rounded overflow-x-auto whitespace-pre-wrap">
            {responseString}
          </div>
        </div>
      )}

      <div className="results">
        <div className="w-full flex justify-center mb-6">
          <div className="flex items-center gap-6 px-4">
            <div className="w-24 h-24 shrink-0 bg-gray-100 rounded-md overflow-hidden relative">
              {hasImage && (
                <div
                  className="absolute inset-0.5"
                  style={{
                    backgroundImage: `url(${imageSrc})`,
                    backgroundSize: "cover",
                    backgroundPosition: "center",
                    filter: "blur(6px)",
                    transform: "scale(1.06)",
                  }}
                />
              )}

              <div className="absolute inset-1 rounded-md">
                <Image
                  src={imageSrc}
                  alt={data.restaurant_name}
                  width={96}
                  height={96}
                  className="w-full h-full object-cover"
                />
              </div>
            </div>
            <div className="flex flex-col justify-center text-center sm:text-left">
              <h2 className="text-2xl mb-1">{data.restaurant_name}</h2>
              {data.daily_menu && (
                <h3 className="text-lg text-gray-600">
                  {data.launch_menu && <span>Polední menu</span>}
                  {data.breakfast_menu && <span>Snídaňové menu</span>}
                  {!data.launch_menu && !data.breakfast_menu && (
                    <span>Denní menu</span>
                  )}
                </h3>
              )}
            </div>
          </div>
        </div>

        {error ? <ErrorMessage message={error} /> : menuContent}
      </div>
    </div>
  );
}
